  const handleClick = (e) => {
    e.preventDefault();
    router.push(href);
  };

  return (
    <div>
      <span>iamport 결제관련한 sample web입니다.</span>
      <a href={"/payment"} onClick={handleClick}>
        결제화면
      </a>
    </div>
  );
};

export default Index;
